import React from 'react';
import ReactDOM from 'react-dom';

import { BrowserRouter } from "react-router-dom"


import App from './App';
import './main.sass'


ReactDOM.render(
  <React.StrictMode>
    <BrowserRouter>
      <App />
    </BrowserRouter>,
  </React.StrictMode>,
  document.getElementById('root')
);
